<b>Our Mission</b></span></span></h2></header><div class="bt_bb_separator bt_bb_border_style_none bt_bb_bottom_spacing_normal bt_bb_hidden_md bt_bb_hidden_lg" data-bt-override-class="null"></div></div></div><div  class="bt_bb_column col-xl-2 bt_bb_align_left bt_bb_vertical_align_top bt_bb_padding_normal"  data-width="2" data-bt-override-class="{}"><div class="bt_bb_column_content"></div></div><div  class="bt_bb_column col-xl-6 bt_bb_align_left bt_bb_vertical_align_top bt_bb_animation_fade_in zoom_out animate bt_bb_padding_normal bt_bb_animation_fade_in bt_bb_animation_zoom_out animate"  data-width="6" data-bt-override-class="{}"><div class="bt_bb_column_content"><div  class="bt_bb_text" ><blockquote>
<div>A mission becomes your constitution, the solid expression of your vision and values. It becomes the criterion by which you measure everything.</div>
</blockquote>
<div style="text-align: right;"></div>
</div></div></div></div></div><div class="bt_bb_row_wrapper"><div  class="bt_bb_row"  data-bt-override-class="{}"><div  class="bt_bb_column col-xl-12 bt_bb_align_left bt_bb_vertical_align_top bt_bb_animation_fade_in animate bt_bb_padding_normal bt_bb_animation_fade_in animate"  data-width="12" data-bt-override-class="{}"><div class="bt_bb_column_content"><div class="bt_bb_separator bt_bb_border_style_solid bt_bb_top_spacing_normal bt_bb_bottom_spacing_medium" style="; border-width: 2px" data-bt-override-class="null"></div><div  class="bt_bb_row_inner" ><div  class="bt_bb_column_inner col-xl-4 bt_bb_align_left bt_bb_vertical_align_top bt_bb_padding_normal"  data-width="4" data-bt-override-class="{}"><div class="bt_bb_column_inner_content"><div  class="bt_bb_text" ><p><span style="font-weight: 400;">Team Waspsrats has been providing commercial &amp; Residential pest control treatment methods in London since 2021. Family owned and locally operated, we treat our customers like our neighbors, because that’s what they are. When you call, you will not be connected to a call center across the country. Your call will be answered by a real person in our office in your own city.</span></p>
<p><span style="font-weight: 400;">Our pest control materials and methods are at the top of the industry, and we also ensure that they are safe and environmentally friendly for our valued customers and their families. We work hard to provide a level of service that our customers feel proud of, proud enough to tell their neighbors and friends and know they will also be taken care of.</span></p>
</div><div class="bt_bb_separator bt_bb_border_style_none bt_bb_bottom_spacing_normal bt_bb_hidden_md bt_bb_hidden_lg" data-bt-override-class="null"></div></div></div><div  class="bt_bb_column_inner col-xl-4 bt_bb_align_left bt_bb_vertical_align_top bt_bb_padding_normal"  data-width="4" data-bt-override-class="{}"><div class="bt_bb_column_inner_content"><div  class="bt_bb_text" ><p><span style="font-weight: 400;">Team Waspsrats  understands that it takes happily involved customers and their word of mouth for our business to continue to grow. We believe that a high level of service starts with a company’s employees. We hire only experienced staff that the customer will be able to count on to provide the best possible service. We run background checks and drug tests on every one of our employees. </span></p>
<p><span style="font-weight: 400;">Not only do we strive for our customers to feel satisfied and secure, but our employees as well. By providing a stable working environment, and constantly training and educating our employees about the ever-changing UK pest control industry, we know that our customers will be treated with the highest level of service, while becoming educated at the same time.</span></p>
<p><span style="font-weight: 400;">Our goal is to protect your home and family safely and efficiently by providing the best Pest Control service!</span></p>
</div><div class="bt_bb_separator bt_bb_border_style_none bt_bb_bottom_spacing_normal bt_bb_hidden_md bt_bb_hidden_lg" data-bt-override-class="null"></div></div></div><div  class="bt_bb_column_inner col-xl-4 bt_bb_align_left bt_bb_vertical_align_top bt_bb_padding_normal"  data-width="4" data-bt-override-class="{}"><div class="bt_bb_column_inner_content"><div class="bt_bb_progress_bar bt_bb_color_scheme_3 bt_bb_align_inherit bt_bb_size_normal bt_bb_style_line bt_bb_shape_rounded" data-bt-override-class="null"><div class="bt_bb_progress_bar_bg"></div><div class="bt_bb_progress_bar_inner animate" style="width:96%"><span class="bt_bb_progress_bar_text">Client Satisfaction</span></div></div><div class="bt_bb_separator bt_bb_border_style_none bt_bb_top_spacing_small" data-bt-override-class="null"></div><div class="bt_bb_progress_bar bt_bb_color_scheme_3 bt_bb_align_inherit bt_bb_size_normal bt_bb_style_line bt_bb_shape_rounded" data-bt-override-class="null"><div class="bt_bb_progress_bar_bg"></div><div class="bt_bb_progress_bar_inner animate" style="width:92%"><span class="bt_bb_progress_bar_text">Effective results</span></div></div><div class="bt_bb_separator bt_bb_border_style_none bt_bb_top_spacing_small" data-bt-override-class="null"></div><div class="bt_bb_progress_bar bt_bb_color_scheme_3 bt_bb_align_inherit bt_bb_size_normal bt_bb_style_line bt_bb_shape_rounded" data-bt-override-class="null"><div class="bt_bb_progress_bar_bg"></div><div class="bt_bb_progress_bar_inner animate" style="width:95%"><span class="bt_bb_progress_bar_text">Projects Success</span></div></div><div class="bt_bb_separator bt_bb_border_style_none bt_bb_top_spacing_small" data-bt-override-class="null"></div><div class="bt_bb_progress_bar bt_bb_color_scheme_3 bt_bb_align_inherit bt_bb_size_normal bt_bb_style_line bt_bb_shape_rounded" data-bt-override-class="null"><div class="bt_bb_progress_bar_bg"></div><div class="bt_bb_progress_bar_inner animate" style="width:89%"><span class="bt_bb_progress_ba